Documentaire
94 minuten

geregisseerd door Yann Arthus-Bertrand en Michael Pitiot
met de stem van Josh Duhamel

Deze natuurdocumentaire probeert niet alleen enkele van de grootste natuurlijke mysteries van onze planeet uit te leggen, maar benadrukt ook het cruciaal belang van de harmonie tussen mens en oceaan. Door een team van onderwatercameramannen, aangestuurd door twee regisseurs, probeert men een veelomvattend beeld weer te geven van de oceanen, het leven daarin en de band tussen de mens en de natuur.



